- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XA\x1CFebruary 9, 2011  Mr. Daniel Buckley
    Federal Election Commission Washington, DC 20463  Amended May Monthly Report Filed
    11-30-2010  Dear Mr Buckley:  In response to your letter dated January 5, 2011,
    regarding the discrepancy between line 21b of the Detailed Summary page disclosed
    amount of $137,549.16 and the itemized Schedule B line 21b disclosed amount of
    $142,469.97, we have reviewed the data and are amending the report to report to
    disclose a voided check to Right Mail in the amount of $5,177.60 inadvertently
    omitted on the amended report.   With the inclusion of that itemized voided check,
    the amount on Line 21b of the Detailed Summary page will be greater than the itemized
    Schedule B total.  The Party voided the check to reconcile the federal cash balance,
    as the check was never negotiated by the vendor.  The vendor has subsequently
    ceased doing business.  A check will be reissued to the previous owner or owners
    of the business as of February 9, 2011.  This reissued check will be disclosed
    on the 2011 March Monthly Report filed by the Party.  Respectfully submitted,
    \ Tom Mechler, Treasurer Republican Party of Texas\n"
